    color: "black",
    height:"100vh",
    width:"100%",
    padding: "3vw",
    margin: "0",
    fontFamily:  "helvetica",
    display: "inline-block",
  }

  return <div style={mystyle}>
  <Stats url='https://covid19.mathdro.id/api'></Stats>
  <CountrySelector></CountrySelector>
  </div>
}
